import React, { Component } from "react"
import "./App.css"
import NavBar from "./components/NavBar"
import Form from "./components/Form"

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <NavBar />
        <div className="container-fluid"></div>
        <Form />
      </React.Fragment>
    )
  }
}

export default App
